import { useEffect } from 'react';
import './App.css';

function App() {

  useEffect(() => {
    fetchData()
  }, [])

  const fetchData = async () => {
    const res = await fetch("https://localhost:8000/todos/")
      .then(response => response.json())
      .then(res => console.log('this is response ->', res))
  }

  return (
    <div className="App">
      this is website
    </div>
  );
}

export default App;
